package Problems;

public class makePalindrome {

	public static String shortestPalindrome(String s) {
		if (s.equals("") ||s.matches("["+s.charAt(s.length()-1)+"]+"))
			return s;
		else {
			String sReversed = new StringBuilder(s).reverse().toString();
			if (sReversed.equals(s))
				return s;
			else {
				int pointer = 0;
				for (int i = 0; i < s.length(); i++) {
					if (s.substring(0,i+1).equals((sReversed.substring((s.length() - 1) - i,
							s.length()))))
						pointer = (s.length() - 1) - i;
				}
				return sReversed.substring(0, pointer) + s;
			}
		}
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		String s = "";
		System.out.println(s.matches("[a]+"));		
		System.out.println(shortestPalindrome("ababbbabbaba"));
	}
}
